La CITYAPP de la Commune de Dudelange vous offre un accès confortable et convivial à une multitude d’informations utiles. 

L’utilisateur peut accéder à différents services qui permettent: 

- de consulter les actualités de la commune ; 
- de contacter directement la commune.
- de reporter à la commune des dysfonctionnements ou problèmes dans la ville 
- de prendre connaissance des départs en temps réel des bus ; 
- de connaitre les arrêts de bus à proximité ;

By The Bay app is designed to enhance the urban lifestyles of professionals working and living by the bay, particularly in and around Marina Bay Financial Centre (MBFC) and One Raffles Quay (ORQ). MBFC and ORQ are premium developments that account for 4.5 million square feet of prime Grade A office and 179,000 square feet of retail space in Singapore’s downtown at Marina Bay.

By The Bay app provides convenient digital access to the buildings and services, information and amenities, flexible workspace solutions. as well as activities and promotions to complement work-live-play lifestyles by the bay. 
Download now to enhance your experience working and living by the bay. 

•	Convenient digital (card-less) access to the buildings and services, including season parking, aircon extension and fault reporting;
•	Information including the most current events, shows and exhibitions happening by the bay;
•	Retail and dining promotions and activities including fitness classes and healthy living workshops, dining and shopping promotions;
•	Concierge services and amenities, wayfinding, umbrellas and power banks on loan etc; as well as
•	Flexible workspace solutions and useful tips on how to conserve the environment. 

